// RentalDetails.js
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function RentalDetails() {
  const { id } = useParams();
  const [rental, setRental] = useState(null);

  useEffect(() => {
    document.title = 'Rental Details';
    console.log("Fetching details for ID:", id);
    fetch(`http://127.0.0.1:8000/api/rentals/${id}/`)
      .then((response) => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then((data) => {
        console.log("Received data:", data);
        setRental(data);
      })
      .catch((error) => {
        console.error('Error fetching rental details:', error);
      });
  }, [id]);

  if (!rental) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary" data-bs-theme="dark">
        <Container fluid>
          <Navbar.Brand href="http://localhost:3000">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="vehicleverse" />
          <Navbar.Collapse id="vehicleverse">
            <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }}>
              <Nav.Link href="http://localhost:3000">Home</Nav.Link>
              <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
              <NavDropdown title="POST" id="navbarScrollingDropdown">
                <NavDropdown.Item href="http://localhost:3000/sell/post">
                  ADD For Sell
                </NavDropdown.Item>
                <NavDropdown.Item href="http://localhost:3000/rent/post">
                  ADD For Rent
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button className="me-2" variant="success">Search</Button>
            </Form>
            <Button variant="danger" href="http://127.0.0.1:8000/login/">Log Out</Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Container className="mt-4">
        <h1 className="text-center">Rental Details</h1>
        <Row>
          <Col md={4}>
            <Card className="mb-4 shadow">
              <Card.Img src={rental.image_link} alt="Rental" style={{ height: '320px' }} />
              <Card.Body>
                  <Card.Title>Vehicle Type: {rental.vehicle_type}</Card.Title>
                  <Card.Text>Phone Number: {rental.phone_number}</Card.Text>
                  <Card.Text>Model: {rental.model}</Card.Text>
                  <Card.Text>Description: {rental.description}</Card.Text>
                  <Card.Text>Price: {rental.price}</Card.Text>
                  <Card.Text>Is Available:
                        <span style={{ color: rental.is_available ? 'green' : 'red' }}>
                            {rental.is_available ? 'Yes' : 'No'}
                        </span>
                </Card.Text>
                </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default RentalDetails;
